import React from "react";
import SongDetails from "./SongDetails";
import { SongContext } from "../contexts/SongContext";

const SongList = () => {
  const { songs } = useContext(SongContext);
  return (
    <div>
      <ul>
        {songs.map(song => {
          return (
            <li>
              {song.title} - {song.singer}
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default SongList;
